import image_dessert from "assets/images/background_desert.jpg"
import image_forest from "assets/images/background_forest.jpg"
import image_underwater from "assets/images/background_underwater.jpg"

import {useState} from 'react'

const coverImages =[
    'image_iceburg','image_dessert', 'image_forest', 'image_underwater'
]

const CardImage = (props) => {
    
    console.log(`${coverImages[0]}`);

    return (
        <div className="absolute pin-t pin-l border-4 border-red w-full h-full">
            {!props.coverImage && <img className="w-full h-full" src={coverImages[0]} />}
        </div>
    )
}

export default CardImage;
